import React from 'react';

function Contact() {
  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-12">Contact Us</h2>
        <div className="max-w-lg mx-auto">
          <form className="space-y-6">
            <input type="text" placeholder="Your Name" className="w-full p-3 border rounded-lg" />
            <input type="email" placeholder="Your Email" className="w-full p-3 border rounded-lg" />
            <textarea placeholder="Your Message" rows="5" className="w-full p-3 border rounded-lg"></textarea>
            <button type="submit" className="w-full bg-blue-600 text-white p-3 rounded-lg hover:bg-blue-700">Send Message</button>
          </form>
          <p className="mt-6 text-center text-gray-600">Email: info@a1renospro.com</p>
          <p className="text-center text-gray-600">Phone: (123) 456-7890</p>
        </div>
      </div>
    </section>
  );
}

export default Contact;
